INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(25, 'MONSTER HUNTER: WORLD™', 1200, 8765, 'Welcome to a new world! Take on the role of a hunter and slay ferocious monsters in a living, breathing ecosystem where you can use the landscape and its diverse inhabitants to get the upper hand. Hunt alone or in co-op with up to three other players, and use materials collected from fallen foes to craft new gear and take on even bigger, badder beasts!\r\n\r\nCopyright:\r\n©CAPCOM CO., LTD. 2018 ALL RIGHTS RESERVED.\r\n', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(26, 'Monster Hunter World: Iceborne', 1200, 9898, 'The base game \"Monster Hunter: World,\" sold separately, is required in order to play this content.\r\n\r\n\"Iceborne\" is a massive expansion that picks up after the ending of Monster Hunter: World and opens up the new \"master rank!\"\r\n\r\nNew quests, monsters, weapons, armor, and story await to take your hunting to the next level!', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(28, 'Crash Bandicoot™ 4: It’s About Time', 3000, 300, 'Buy digitally and get the Totally Tubular Skins for Crash and Coco*.\r\n\r\nGet time-shattering skins \'Marsupus Erectus\' and \'Serious Upgrade\', first on PlayStation®**.\r\n\r\nIt’s About Time - for a brand-wumping new Crash Bandicoot™ game! Crash fourward into a time shattered adventure with your favourite marsupials.\r\n\r\nNeo Cortex and N. Tropy are back at it again and launching an all-out assault on not just this universe, but the entire multiverse! Crash and Coco are here to save the day by reuniting the four Quantum Masks and bending the rules of reality.\r\n\r\nNew abilities? Check. More playable characters? Yep. Alternate dimensions? Obviously. Ridonkulous bosses? For sure. Same awesome sauce? You bet your sweet jorts. Wait, are they actually jorts? Not in this universe!', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(29, '《巫師 3：狂獵》年度最佳遊戲版', 599, 10000, '昆特牌是本體', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(31, 'FINAL FANTASY VII REMAKE', 1790, 8888, '1997年於PlayStation®發售的FINAL FANTASY VII，如今加入多種新因子重生為「全新故事」。指令式戰鬥融合操作直覺的動作系統，衍生出更豐富的戰略性。遊戲畫面則運用20年前不可能實現的技術，打造出身歷其境的FFVII世界。', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(33, '《刺客教條：維京紀元》- 數位標準版', 1790, 800, '在《刺客教條：維京紀元》化身追求榮耀的傳奇維京劫掠者「埃沃爾」。劫掠敵人、發展聚落、培養政治權力，探索英格蘭黑暗時代。', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(34, 'Sackboy: A Big Adventure 數位豪華版', 2290, 666, '透過深度沉浸式且富表現力的控制方式，探索獨特的工藝世界，同時面對一連串難以預料的刺激挑戰。\r\n\r\n玩家可以單槍匹馬挑戰這個驚險萬分、分秒必爭的史詩旅程，也可以與 2 至 4 名冒險家組隊，享受樂趣無窮的團隊遊戲，一同克服意想不到的凶險任務。\r\n你有辦法戰勝卑鄙的費克斯和他可怕的顛倒機器，拯救工藝世界，並成為傳奇的針織騎士嗎？', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(35, '《電馭叛客 2077》 (中英文版)', 1590, 980, '動作冒險開放世界《電馭叛客 2077》將讓你深入沉溺於肉體改造、爭權奪利又紙醉金迷的巨型都市「夜城」。化身非法傭兵 V，尋找某種絕無僅有的植入物，掌握長生不死的關鍵。自由打造角色的生化改造裝置、技能及遊玩風格，並盡情探索一望無際的巨型城市，讓每一次抉擇逐步左右劇情與世界的走向。', , 1);
INSERT INTO `products` (`id`, `name`, `price`, `quantity`, `description`, `image`, `enabled`) VALUES
(36, '《極地戰嚎 6》- 數位標準版 (遊戲)', 1790, 0, '歡迎來到亞拉，一個時間被定格的熱帶天堂。亞拉的獨裁者安東．卡斯迪路意圖讓兒子迪亞哥追隨他血流成河的腳步，不計一切代價恢復國家的昔日榮光。他們的無情壓迫已點燃革命之火。', , 1);

